        <input type="text" id="Appearance" name="Appearance" placeholder="Appearance"></input>
        <input type="text" id="Interests" name="Interests" placeholder="Interests"></input>
        <input type="text" id="Personality" name="Personality" placeholder="Personality"></input>
        <input type="text" id="Occupation" name="Occupation" placeholder="Occupation"></input>
        <div>
            <button className="generator">Generate Pick Up Lines</button>
        </div>
    </div>
  );
}

export default Fields;
